import { React } from 'react';
import styles from './userdata.module.css'

const UserData = (props) => {
    return (
        <div className={userdata.userdata}>
            <p>Username{props.Username}</p>
            <p>Age{props.Age}</p>
        </div>
    )
}

export default UserData;
